from typing import Dict, Any

def merge_dicts(*dicts: Dict[Any, Any]) -> Dict[Any, Any]:
    """
    Merge multiple dictionaries into a single dictionary.

    Later dictionaries override earlier ones when keys conflict.
    None values are handled gracefully - None dictionaries are skipped.

    Args:
        *dicts: Variable number of dictionaries to merge

    Returns:
        A new dictionary containing merged key-value pairs

    Raises:
        TypeError: If any non-dict argument is passed (except None)
        ValueError: If no valid dictionaries are provided

    Example:
        >>> merge_dicts({"a": 1}, {"b": 2})
        {"a": 1, "b": 2}
        >>> merge_dicts({"a": 1}, {"a": 2})
        {"a": 2}
    """
    if not dicts:
        raise ValueError("At least one dictionary must be provided")

    result: Dict[Any, Any] = {}
    valid_dicts_found = False

    for d in dicts:
        # Skip None values gracefully
        if d is None:
            continue

        # Validate that the argument is a dictionary
        if not isinstance(d, dict):
            raise TypeError(
                f"Expected dict or None, got {type(d).__name__}: {d!r}"
            )

        valid_dicts_found = True
        result.update(d)

    if not valid_dicts_found:
        raise ValueError("At least one valid dictionary must be provided (all were None)")

    return result


