    assert merge_dicts({"a": 1}, {"a": 2}) == {"a": 2}
    print("✓ Override behavior works")

    # Multiple dictionaries
    assert merge_dicts({"a": 1}, {"b": 2}, {"c": 3}) == {"a": 1, "b": 2, "c": 3}
    print("✓ Multiple dictionary merge works")

    # None handling
    assert merge_dicts({"a": 1}, None, {"b": 2}) == {"a": 1, "b": 2}
    print("✓ None values handled gracefully")

    # Empty dictionary handling
    assert merge_dicts({}, {"a": 1}) == {"a": 1}
    print("✓ Empty dictionary handling works")

    # Single dictionary
    assert merge_dicts({"a": 1}) == {"a": 1}
    print("✓ Single dictionary works")

